	add("dystocia", "{\"term\":\"dystocia\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027δυστοκία\u0027 (difficult childbirth) from \u0027δυσ-\u0027 (bad) + \u0027τόκος\u0027 (childbirth) from \u0027τίκτω\u0027 (i give birth)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A slow or difficult labour or delivery\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, James Mahoney, \u0027Primate Management: Medical Care\u0027, Sonia Wolfe-Coote (editor), \u0027The Laboratory Primate\u0027, [http://books.google.com.au/books?id\u003dnCZHS0A1_lsC\u0026amp;pg\u003dRA1-PA2030\u0026amp;dq\u003d%22dystocia%22%7C%22dystocias%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003drU4aUba8EMj9lAWLhIDQBw\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22dystocia%22%7C%22dystocias%22\u0026amp;f\u003dfalse page 256\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In macaques, baboons and chimpanzees, \u0027\u0027dystocia\u0027\u0027 because of breech birth is the commonest category of fetal death.Breech \u0027\u0027dystocia\u0027\u0027 is rarely a problem for mother or neonates in small, multitocus species like marmosets and tamarins.\u0026lt;!-- multitocus? - maybe multilocus? - No, multitocus means giving birth to many young at once--\u0026gt\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Richard Aghababian, \u0027Essentials of Emergency Medicine\u0027, [http://books.google.com.au/books?id\u003d7d_O911cFAIC\u0026amp;pg\u003dPA480\u0026amp;dq\u003d%22dystocia%22%7C%22dystocias%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003drU4aUba8EMj9lAWLhIDQBw\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22dystocia%22%7C%22dystocias%22\u0026amp;f\u003dfalse page 480\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Dystocia\u0027\u0027 is defined as difficult delivery. Pelvic \u0027\u0027dystocia\u0027\u0027 is due to aberrations of the pelvic architecture and its relationship to the presenting fetal part.Fetal \u0027\u0027dystocia\u0027\u0027 may be due to excessive fetal size from gestational diabetes or congenital anomalies\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2008\u0027\u0027, Dan Rice, \u0027The Complete Book of Dog Breeding\u0027, 2nd Edition, [http://books.google.com.au/books?id\u003dCWPXxTSPrkwC\u0026amp;pg\u003dPA96\u0026amp;dq\u003d%22dystocias%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dwSAbUfKNL9HymAWZ54C4Ag\u0026amp;redir_esc\u003dy page 96\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Although fetal \u0027\u0027dystocias\u0027\u0027 are sometimes relieved by manipulation and instrumentation, cesarean sections are often the only practical methods of treatment\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, James A. O′Leary, \u0027Shoulder \u0027\u0027Dystocia\u0027\u0027 and Birth Injury: Prevention and Treatment\u0027, [http://books.google.com.au/books?id\u003ddm2k4eONyVcC\u0026amp;pg\u003dPA102\u0026amp;dq\u003d%22dystocia%22%7C%22dystocias%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003drU4aUba8EMj9lAWLhIDQBw\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22dystocia%22%7C%22dystocias%22\u0026amp;f\u003dfalse page 102\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"It is an appropriate way to allow resolution of the \u0027\u0027dystocia\u0027\u0027, after clearing the airway and checking for a nuchal cord\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The prevailing thinking is that the time window in which to resolve a shoulder \u0027\u0027dystocia\u0027\u0027 before asphyxial insult (not injury) is about 4 minutes\", \"priority\":13}]}, \"synonyms\":{}}");

